import './SideBar.css';
import SLACA13Png from './Images/13SLACA.png'

function SideBar()
{
    return(
        <div>
            <section id='SideBar'>
                <div className='Header'>
                    SLACA 2019
                </div>
                <img src={SLACA13Png}></img>
            </section>
        </div>
    )
}

export default SideBar;
